import * as services from "../services/zimmetServices";
import "..src/ZimmetPage.css";
import { useState, useEffect } from "react";

export default function ZimmetPage() {
  const [zimmetList, setZimmetList] = useState();

  useEffect(() => {
    if (!zimmetList) {
      services.getZimmet().then((res) => {
        setZimmetList(res.data);
        console.log(res);
      });
    }
  }, [zimmetList]);

  return (
    <div className="zimmet-table-container">
        <h1>Zimmet Listesi</h1>
        <table className="zimmet-table">
            <thead>
                <tr>
                    <th>Zimmet Id</th>
                    <th>Statu</th>
                    <th>Personel SicilNo</th>
                    <th>Personel Adı</th>
                    <th>Personel Soyadı</th>
                    <th>Personel Birimi</th>
                    <th>Personel Görevi</th>
                    <th>Envanter Tipi</th>
                    <th>Envanter Markası</th>
                    <th>Envanter Modeli</th>
                </tr>
            </thead>
            <tbody>
                {zimmetList.map((item, key) => (
                    <tr key={key}>
                        <td>{item?.zimmetId}</td>
                        <td>{item?.statu}</td>
                        <td>{item?.personelDto?.personelSicilNo}</td>
                        <td>{item?.personelDto?.personelName}</td>
                        <td>{item?.personelDto?.personelSurname}</td>
                        <td>{item?.personelDto?.personelBirimi}</td>
                        <td>{item?.personelDto?.personelGorevi}</td>
                        <td>{item?.envanterDto?.envanterTipi?.envanterTipAdi}</td>
                        <td>{item?.envanterDto?.envanterMarkasi}</td>
                        <td>{item?.envanterDto?.envanterModel}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </div>
);
}
